function buildNodesAndIndexes(response){self.maxSankeyChartDepth=0;self.maxNodeLength=0;var links=[];var nodes=[];var depthNodes=[];var depth;var i=0,j=0,k=0,nodeIndex=0;for(i=0;i<response.length;i++){depth=response[i].label;if(depth>self.maxSankeyChartDepth){setMaxSankeyChartDepth(depth);}}
if(self.numSteps>self.maxSankeyChartDepth){self.numSteps=self.maxSankeyChartDepth;}
for(i=0;i<response.length;i++){var depthRow=response[i];depth=depthRow.label;if(!depthRow.subtable){continue;}
if((depthRow.subtable.length+1)>self.maxNodeLength){setMaxNodeLength(depthRow.subtable.length+1);}
if(depth>self.numSteps){continue;}
var depthNode={depth:depth-1,in:0,out:0,totalIn:depthRow.nb_visits,totalOut:depthRow.nb_proceeded,totalExits:depthRow.nb_exits,};j=0;for(j;j<depthRow.subtable.length;j++){var sourceRow=depthRow.subtable[j];var sourceLabel=sourceRow.label;if(!isSummaryNode(sourceLabel)){depthNode.in+=sourceRow.nb_visits;depthNode.out+=sourceRow.nb_proceeded;}
nodes.push({depth:depth-1,name:sourceLabel,node:nodeIndex,totalIn:sourceRow.nb_visits,totalOut:sourceRow.nb_proceeded,totalExits:sourceRow.nb_exits,pagesInGroup:sourceRow.nb_pages_in_group?sourceRow.nb_pages_in_group:0,isSummaryNode:isSummaryNode(sourceLabel),idSubtable:sourceRow.idsubdatatable?sourceRow.idsubdatatable:null});nodeIndex++;if(depth>=self.numSteps){continue;}
if(!sourceRow.subtable){continue;}
k=0;for(k;k<sourceRow.subtable.length;k++){var targetRow=sourceRow.subtable[k];var targetLabel=targetRow.label;links.push({depth:depth,source:nodeIndex-1,target:targetLabel,value:targetRow.nb_visits});}
if(sourceRow.nb_exits){links.push({depth:depth,source:nodeIndex-1,target:OUT_NODE_NAME,value:sourceRow.nb_exits});}}
depthNodes.push(depthNode);if(depth>1){nodes.push({depth:depth-1,name:OUT_NODE_NAME,node:nodeIndex,value:0,totalIn:0});nodeIndex++;}}
angular.forEach(links,function(link){some(nodes,function(element){if(link.target==element.name&&link.depth==element.depth){link.target=element.node;return true;}});});return{nodes:nodes,links:links,depthNodes:depthNodes};}
