function fetchData(){clearSankeyCahrt();if(self.exploreStep&&self.exploreUrl){self.isExploringTraffic=true;}else{self.isExploringTraffic=false;}
self.isLoading=true;self.rawResponse=[];var params={method:'UsersFlow.getUsersFlow',expanded:'1',filter_limit:'-1',dataSource:self.userFlowSource,limitActionsPerStep:self.numActionsPerStep};if(self.exploreStep&&self.exploreUrl){params.exploreStep=self.exploreStep;params.exploreUrl=self.exploreUrl;}
piwikApi.fetch(params).then(function(response){self.isLoading=false;self.rawResponse=response;clearSankeyCahrt();if(response&&response.length>0){var nodesAndLinks=buildNodesAndIndexes(self.rawResponse);drawSankeyChart(nodesAndLinks);}else{self.hasData=false;}});}
